import React from 'react';
import './WaterproofingServices.css';

function WaterproofingServices() {
  return (
    <div className="waterproofing-container">
      <div className="waterproofing-background">
        <div className="waterproofing-content">
          <h1>Waterproofing Services In NYC</h1>
          <p>Protect your property with our exceptional waterproofing services in NYC, trusted by thousands for over 30 years.</p>
        </div>
      </div>
      <div className="waterproofing-info-section">
        <div className="waterproofing-info-text">
          <h2>Waterproofing Contractor NYC â€“ Expert Solutions for a Safe and Dry Property</h2>
          <p>Brick Tech Contracting Corp stands as the top waterproofing contractor NYC relies on for a wide range of waterproofing services. Our 30 years of experience in the construction industry equip us with the necessary knowledge and skills to protect your property from water damage effectively. Our comprehensive services include basement, building, roof, and exterior waterproofing solutions, ensuring that your property remains dry and secure.</p>
        </div>
        <div className="waterproofing-info-image">
          <img src="./Pictures/Waterproofingimage2.png" alt="Waterproofing Example" /> {/* Replace with your image path */}
        </div>
      </div>
    </div>
  );
}

export default WaterproofingServices;
